import React from 'react';
import { Nav, Navbar } from 'react-bootstrap';
import styled from 'styled-components';
import mapImage from '../assets/map.svg';

const Styles = styled.div`
	.navbar {
		background-color:black !important;
		opaque: 0.2;
		height: 80px;
		position: absolute;
		width: 80%;
		z-index: 20000;
		padding-left: 100px;
	}

	.navbar-brand {
		color: black;
		font-size: 5rem;

	}

	.navbar-brand:hover {
		color: teal;
	}
`;


export const NavigationBar = () => (
	<Styles>
		<Navbar className="navbar .z-depth-2 justify-content-end float-right">
			<img
		        alt=""
		        src={mapImage}
		        width="100px"
		        height="70px"
		      />{' '}
		     Global-Port
		</Navbar>

	</Styles>

	)
